import React from 'react';

export default function Header() {
    return (
        <>
            <div className="header">
                <img className="header__logo" src="../src/assets/Logo/Logo-brainflix.svg" alt="Brainflix" />
                <input className="header__search" type="search" value="" placeholder="Search" />
                <button className="header__upload">+ UPLOAD</button>
            </div>
        </>
    );
}
